  setPosition(window.scrollY);
 }
 useEffect(()=>{
  window.addEventListener("scroll",onScroll);
  return ()=>{
    window.removeEventListener("scroll",onScroll)
  }
 },[])
  return (
    <div  className='Home'>
    <div className='Home-imgDiv1'>
      <img src='./img/Court.jpg' alt='Court'/>
    </div>
    <div className='Home-imgDiv2'>
      <h1 onScroll={onScroll} className='Home-text1'>뉴져지 통역 대행 서비스</h1>

    </div>
    <div className='Home-img3'>
    <img src='./img/njfc_logo.jpg' alt='njfamilycare'/>
    </div>
    </div>
  )
}

export default Home
